    "2016-07-27T23:02:51.722776",nt"name": "muskox-census",nt"isopen": false,nt"url":
    null,nt"notes": "A total of 148 muskox in 7 groups were counted. A few muskox
    were probably missed during the census and the total of 148 muskox represents the
    minimum re-calving population. Dispersal of muskox from the three largest muskox
    groups has involved only small bull groups to date and it is not likely that the
    true size of the population is significantly larger. Composition and location of
    muskox groups are presented in attached Table 1 and map. High productivity, low
    mortality and dispersal of mature bulls from larger muskox groups appears to be
    a continuing trend.",nt"license_title": "License Not Specified",nt"extras":
